-- QUERY ORDER:
-- TRUNCATE DATA
-- ALTER TABLE TO NOT NULL
-- IMPORT BLANKED DATA
-- DELETE BLANKS
-- ALTER TABLE TO NULL
-- SET BLANKS TO NULL

TRUNCATE creature_addon;
TRUNCATE creature_template_addon;

ALTER TABLE creature_addon
  CHANGE COLUMN auras auras TEXT NOT NULL AFTER emote;
ALTER TABLE creature_template_addon
  CHANGE COLUMN auras auras TEXT NOT NULL AFTER emote;


  
DELETE FROM creature_addon WHERE path_id=0 AND mount=0 AND bytes1=0 AND bytes2=0 AND emote=0 AND auras='';
DELETE FROM creature_template_addon WHERE path_id=0 AND mount=0 AND bytes1=0 AND bytes2=0 AND emote=0 AND auras='';

ALTER TABLE creature_addon
  CHANGE COLUMN auras auras TEXT NULL AFTER emote;
ALTER TABLE creature_template_addon
  CHANGE COLUMN auras auras TEXT NULL AFTER emote;

UPDATE creature_addon SET auras = NULL WHERE LENGTH(auras)=0;
UPDATE creature_template_addon SET auras = NULL WHERE LENGTH(auras)=0;
